Object(r.a)(JSON.parse('{"ar":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"حول مجموعات التسجيل الذاتي","self_signup_description":"يمكنك إنشاء مجموعات من المجموعات ويمكن للطلاب التسجيل في مجموعات يمتلكونها. ولا يزال يقتصر على الطلاب التسجيل بمجموعة واحدة بكل مجموعة من المجموعات، ولكن بهذه الطريقة يمكن للطلاب تنظيم أنفسهم في مجموعات بدلاً من الحاجة إلى قيام المدرس بالعمل. لاحظ أنه ما دام هذا الخيار ممكنًا، يمكن للطلاب نقل أنفسهم من مجموعة إلى أخرى."}}}},"cy":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Gwybodaeth am grwpiau cofrestru eich hun","self_signup_description":"Gallwch greu setiau o grwpiau y bydd myfyrwyr yn gallu cofrestru ar eu cyfer ar eu pen eu hunain. Bydd myfyrwyr yn dal i gael eu cyfyngu i fod mewn un grŵp yn unig yn y set, ond mae hyn yn golygu bod myfyrwyr yn gallu rhoi eu hunain mewn grwpiau yn hytrach na bod angen i’r athro wneud hynny. Cofiwch, os yw’r opsiwn hwn wedi’i alluogi, bydd myfyrwyr yn gallu symud eu hunain o un grŵp i’r llall."}}}},"da":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Om grupper med selvtilmelding","self_signup_description":"Du kan oprette gruppesæt, hvor de studerende selv kan tilmelde sig. De studerende er stadig begrænset til kun at være medlem af én gruppe, men på denne måde kan de studerende selv organisere sig i grupper i stedet for at være afhængige af, at læreren gør det for dem. Bemærk, at de studerende frit kan af-og tilmelde sig grupper, så længe denne mulighed er aktiveret."}}}},"da-x-k12":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Om grupper med selvtilmelding","self_signup_description":"Du kan oprette gruppesæt, hvor eleverne selv kan tilmelde sig. Eleverne er stadig begrænset til kun at være medlem af én gruppe, men på denne måde kan eleverne selv organisere sig i grupper i stedet for at være afhængige af, at læreren gør det for dem. Bemærk, at eleverne frit kan af-og tilmelde sig grupper, så længe denne mulighed er aktiveret."}}}},"de":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Info zu Selbstregistrierungsgruppen","self_signup_description":"Sie können Gruppensets aus Gruppen erstellen, bei denen sich die Studenten selbst anmelden können. Die Studenten sind immer noch auf eine Gruppe im Set beschränkt, sie können sich auf diese Weise jedoch ohne Unterstützung des Dozenten selbst in Gruppen organisieren. Beachten Sie, dass die Studenten selbst die Gruppe wechseln können, solange diese Option aktiviert ist."}}}},"el":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Σχετικά με τις Ομάδες Αυτο-εγγραφής","self_signup_description":"\\u003cmrk mid=\\"6526\\" mtype=\\"seg\\"\\u003eΜπορείτε να δημιουργήσετε σετ ομάδων όπου οι σπουδαστές θα μπορούν να εγγράφονται μόνοι τους.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6527\\" mtype=\\"seg\\"\\u003eΟι σπουδαστές μπορούν να εγγράφονται ακόμη σε μία μόνο ομάδα του σετ, αλλά έτσι οι σπουδαστές μπορούν να οργανώνονται οι ίδιοι σε ομάδες αντί να χρειάζεται να το κάνει αυτό ο καθηγητής.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6528\\" mtype=\\"seg\\"\\u003eΣημειώνεται ότι όσο αυτή η επιλογή είναι ενεργοποιημένη, οι σπουδαστές μπορούν να μετακινούνται από μια ομάδα σε άλλη.\\u003c/mrk\\u003e"}}}},"en-AU":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"About Self Sign-up Groups","self_signup_description":"You can create sets of groups where students can sign up on their own. Students are still limited to being in only one group in the set, but this way students can organise themselves into groups instead of needing the teacher to do the work. Note that as long as this option is enabled, students can move themselves from one group to another."}}}},"en-CA":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"About Self Sign-up Groups","self_signup_description":"You can create sets of groups where students can sign up on their own. Students are still limited to being in only one group in the set, but this way students can organize themselves into groups instead of needing the teacher to do the work. Note that as long as this option is enabled, students can move themselves from one group to another."}}}},"en-GB":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"About Self Sign-up Groups","self_signup_description":"You can create sets of groups where students can sign up on their own. Students are still limited to being in only one group in the set, but this way students can organise themselves into groups instead of needing the teacher to do the work. Note that as long as this option is enabled, students can move themselves from one group to another."}}}},"es":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Sobre los grupos de autorregistro","self_signup_description":"Puede crear conjuntos de grupos en los que los estudiantes se puedan registrar solos. Los estudiantes seguirán teniendo que pertenecer a un solo grupo del conjunto, pero de esta forma se podrán organizar en grupos ellos mismos en vez de tener que hacerlo el profesor. Recuerde que mientras esta función esté habilitada, los estudiantes podrán moverse de un grupo a otro."}}}},"fa":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"درباره گروه های ثبت نام شخصی","self_signup_description":"می توانید مجموعه هایی از گروه ها را ایجاد کنید که خود دانشجویان بتوانند در آنها ثبت نام کنند. دانشجویان هنوز محدود به عضویت در تنها یک گروه در مجموعه هستند، ولی به این طریق می توانند به جای نیاز به اینکه استاد آنها را در گروه ها سازماندهی کنند، خودشان این کار را انجام دهند. توجه داشته باشید تا هنگامی که این گزینه فعال باشد، دانشجویان می توانند خود را از یک گروه به گروه دیگر انتقال دهند.\\n "}}}},"fi":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Tietoja ryhmistä, joihin on itserekisteröinti","self_signup_description":"Voit luoda ryhmien joukkoja, joihin opiskelijat voivat rekisteröityä itse. Opiskelijat ovat yhtä rajoitettuja yhteen ryhmään määrityksessä, mutta näin opiskelijat voivat organisoida itsensä ryhmiin sen sijaan, että opettajan tarvitsisi tehdä työtä. Huomaa, että niin kauan kuin tämä vaihtoehto on käytössä, opiskelijat voivat siirtää itsensä yhdestä ryhmästä toiseen."}}}},"fr":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"À propos des groupes d’inscription libre","self_signup_description":"Vous pouvez créer des ensembles de groupes auxquels les étudiants peuvent s’inscrire eux-mêmes. Ils ne peuvent appartenir qu’à un seul groupe de l’ensemble, mais cela leur permet de s’organiser eux-mêmes en groupes sans que l’instructeur ait à intervenir. Tant que cette option est activée, les étudiants peuvent passer d’un groupe à l’autre."}}}},"fr-CA":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"À propos des groupes d’inscription libre","self_signup_description":"Vous pouvez créer des ensembles de groupes auxquels les étudiants peuvent s’inscrire eux-mêmes. Ils ne peuvent appartenir qu’à un seul groupe de l’ensemble, mais cela leur permet de s’organiser eux-mêmes en groupes sans que l’instructeur ait à intervenir. Tant que cette option est activée, les étudiants peuvent passer d’un groupe à l’autre."}}}},"he":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"אודות קבוצות רישום עצמי","self_signup_description":"ניתן להגדיר אוספי קבוצות כדי שתלמידים יוכלו להרשם באופן עצמאי. בכל מקרה התלמידים יוכלו להשתתף רק בקבוצה אחת באוסף , אך בדרך זו יוכלו לארגן לעצמם קבוצות במקום להיות תלויים במורה לבצע זאת עבורם. יש לשים לב שכל עוד אפשרות זו מופעלת, תלמידים יכולים לעבור מקבוצה לקבוצה."}}}},"ht":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Osijè de Gwoup Oto Enskripsyon yo","self_signup_description":"Ou kapab kreye yon ansanm gwoup kote elèv yo ka enskri pou kont yo. Elèv yo toujou limite pou yo nan yon sèl gwoup nan ansanm nan, men konsa elèv yo ka òganize yo an gwoup olye ke yo bezwen yon pwofesè poufè travay la. Note ke toutotan opsyon sa a aktive, elèv yo ap ka deplase de yon gwoup a yon lòt pou kont yo."}}}},"hu":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Az önálló feliratkozású csoportokról","self_signup_description":"Létre tud hozni csoporthalmazokat ahová a hallgatók maguktól jelentkezhetnek fel. A hallgatók így is csak egy csoportban lehetnek minden halmazban, de így a hallgatók csoportokba szervezhetik magukat ahelyett, hogy az oktatók tennék ezt. Azt is megkövetelheti, hogy a csoport tagjai mindannyian ugyanabban a kurzusszekcióban legyenek. Tartsa észben, hogy amíg ez az opció engedélyezett, addig a hallgatók áttehetik magukat az egyik csoportból a másikba."}}}},"hy":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Ինքնագրանցվող խմբերի մասին","self_signup_description":"Դուք կարող եք խմբերի շարքեր ստեղծել, որտեղ ունկնդիրները կարող են ինքնուրույն գրանցվել: Ունկնդիրները կարող են ընդգրկվել տվյալ շարքի միայն մի խմբում,  սակայն այս կերպ ունկնդիրները կարող են կազմակերպվել խմբերում, եւ աշխատանքի կատարման համար դասավանդող չի պահանջվի: Հիշեք, որ քանի դեռ այս օպցիան ակտիվ է, ուսանողները կարող են տեղափոխվել մի խմբից մյուսը :"}}}},"is":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Um sjálfskráða hópa","self_signup_description":"Þú getur stofnað hópasett sem nemendur skrá sig sjálfir í. Nemendur geta enn aðeins verið í einum hópi í hverju setti en svona geta nemendur raðað sér sjálfir í hópa í stað þess að kennarinn geri það. Meðan þessi kostur er virkur geta nemendur fært sig milli hópa að vild."}}}},"it":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Informazioni sui gruppi con registrazione automatica","self_signup_description":"Puoi creare un set di gruppi in cui gli studenti possono registrarsi autonomamente. Il limite che impone agli studenti di trovarsi in un solo gruppo del set continua a essere applicato, ma in questo modo gli studenti possono organizzarsi in gruppi in autonomia anziché rivolgersi all\'insegnante. Tieni presente che finché l\'opzione è abilitata, gli studenti possono spostarsi da un gruppo all\'altro."}}}},"ja":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"セルフ サインアップ グループについて","self_signup_description":"受講生によるセルフ サインアップが可能なグループ セットを作成できます。受講生はグループ セット内の 1 つのグループにしかサインアップできませんが、このオプションを使用すると、講師が受講生をグループに振り分けなくても、受講生が自分でグループを選択できます。このオプションを有効にしている場合は、受講生が自分で別のグループに移動できることに注意してください。"}}}},"ko":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"직접 등록 그룹에 대한 정보","self_signup_description":"학생이 직접 등록할 수 있는 그룹의 집합을 만들 수 있습니다. 학생은 집합에 있는 하나의 그룹에만 속할 수 있지만, 이러한 방식으로 교사 대신 학생들이 스스로 그룹을 구성할 수 있습니다. 이 옵션을 사용하면 학생이 하나의 그룹에서 다른 그룹으로 직접 이동할 수 있습니다."}}}},"mi":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Mō whaiaro Waitohu-ake ngā rōpū","self_signup_description":"Ka taea e koe te hanga i ngā huinga o ngā rōpū i reira e taea te haina ake ngā ākonga i runga i to ratou ake. E whāiti ana ngā ākonga tonu ki te i roto i te kotahi anake te rōpū i roto i te huinga, ēngari ka taea e tēnei ara ākonga te whakarite ia ratou ki ngā rōpū hei utu o te hinaaro nei i te kaiako ki te mahi i te mahi. Tuhipoka e rite te roa rite te whakahohea tēnei kōwhiringa te, ngā ākonga e taea te neke ratou i tētahi rōpū ki tētahi."}}}},"nb":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Om grupper med egenpåmelding","self_signup_description":"Du kan lage sett med grupper der studentene kan melde seg på egenhånd. Studentene er fortsatt begrenset til å være i bare én gruppe i settet, men på denne måten kan studentene organisere seg i grupper selv, i stedet for å ha faglæreren til å gjøre arbeidet. Merk at så lenge dette alternativet er aktivert, kan studentene flytte seg fra en gruppe til en annen."}}}},"nb-x-k12":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Om grupper med egenpåmelding","self_signup_description":"Du kan lage sett med grupper der elevene kan melde seg på egenhånd. Elevene er fortsatt begrenset til å være i bare én gruppe i settet, men på denne måten kan elevene organisere seg i grupper selv, i stedet for å ha faglæreren til å gjøre arbeidet. Merk at så lenge dette alternativet er aktivert, kan elevene flytte seg fra en gruppe til en annen."}}}},"nl":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Over zelfinschrijvingsgroepen","self_signup_description":"Je kunt reeksen van groepen maken waar cursisten zichzelf voor kunnen inschrijven. Cursisten kunnen zich maar voor één groep uit de reeks inschrijven, maar op deze manier kunnen cursisten de groepsindelingen onderling regelen zonder hulp van de docent. Houd in gedachten dat cursisten zich van de ene groep naar de andere groep kunnen verplaatsen."}}}},"nn":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Om sjølvregistreringsgrupper","self_signup_description":"Du kan opprette sett med grupper der studentar registrerer seg sjølve. Studentane kan framleis ta del i berre ei gruppe i settet, men på denne måten kan dei sjølve organisere seg i grupper i staden for at faglæraren gjer det. Merk deg at så lenge dette alternativet er aktivert, kan studentane flytte mellom gruppene."}}}},"pl":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Informacje na temat grup z możliwością samodzielnego zapisu","self_signup_description":"Możesz stworzyć zestawy grup, w których studenci mogą zapisywać się na własną rękę. Uczestnicy są nadal ograniczeni do bycia tylko w jednej grupie w zestawie, ale w ten sposób uczestnicy mogą organizować się w grupy, wyręczając w tej czynności nauczyciela. Pamiętaj, że w trakcie uaktywnienia tej opcji uczestnicy mogą przenosić się z jednej grupy do drugiej."}}}},"pt":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Sobre grupos de auto-inscrição","self_signup_description":"Pode criar conjuntos de grupos, nos quais os alunos podem inscrever-se sozinhos. Os alunos continuam limitados a pertencer apenas a um grupo do conjunto, mas dessa forma os alunos podem organizar-se em grupos em vez de precisarem que o professor faça esse trabalho. Tenha em atenção que os alunos podem mover-se de um grupo para outro enquanto esta opção estiver ativada."}}}},"pt-BR":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Sobre grupos de autorregistro","self_signup_description":"Você pode criar conjuntos de grupos em que os alunos podem se registrar sozinhos. Os alunos ainda estão limitados a estarem em apenas um grupo no conjunto, mas, desta forma, os alunos podem se organizar em grupos ao invés de precisarem de um professor para fazer isso. Note que, enquanto esta opção estiver ativa, os alunos podem ir de um grupo para outro."}}}},"ru":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"О группах с самостоятельной регистрацией","self_signup_description":"Вы можете создавать наборы групп, где студенты могут регистрироваться самостоятельно. Студенты по-прежнему ограничены возможностью находиться только в одной группе из набора, однако, таким образом, студенты могут сами объединяться в группы, снимая с преподавателя необходимость делать это. Учтите, что до тех пор, пока активна эта опция, студенты могут переводить себя из одной группы в другую."}}}},"sl":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Vizitka skupin s samostojno včlanitvijo","self_signup_description":"Ustvarjate lahko nabore skupin, v katere se študenti lahko samostojno včlanijo. Študenti so še vedno omejeni na to, da so samo v eni skupini v naboru, ampak na ta način se lahko organizirajo v skupine, namesto da bi za to potrebovali izvajalca. Ne prezrite, da se lahko študenti premikajo iz ene v drugo skupino, dokler je ta možnost omogočena."}}}},"sv":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Om självregistreringsgrupper","self_signup_description":"Du kan skapa grupper där studenter själva kan registrera sig. Studenter är fortfarande begränsade till en grupp per uppsättning, men på det här sättet kan studenter själva organisera sig utan att deras lärare utför arbetet. Observera att så länge det här alternativet är aktivt kan studenterna flytta sig själva från en grupp till en annan."}}}},"sv-x-k12":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Om självregistreringsgrupper","self_signup_description":"Du kan skapa grupper där elever själva kan registrera sig. Elever är fortfarande begränsade till en grupp per uppsättning, men på det här sättet kan elever själva organisera sig utan att deras lärare utför arbetet. Observera att så länge det här alternativet är aktivt kan eleverna flytta sig själva från en grupp till en annan."}}}},"tr":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Gruplara Hızlı Üye Olma Hakkında","self_signup_description":"Öğrencilerin kendilerini kaydedebildikleri grup setleri oluşturabilirsiniz. Öğrenciler hala yalnızca bir grubun içinde olabilirler fakat bu şekilde öğretmenin yapmasına gerek kalmadan öğrenciler kendilerini gruplar içinde organize edebilirler. Unutmayın, bu seçenek etkinken öğrenciler kendilerini bir gruptan diğerine taşıyabilirler."}}}},"uk":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"Про групи самостійної реєстрації","self_signup_description":"Ви можете створювати набори груп, до яких студенти можуть зареєструватися самостійно. Студенти, як і раніше обмежені членством тільки в одній групі з набору, але таким чином студенти можуть об\'єднуватися в групи замість того, щоб це робили вчителі. Зверніть увагу, що до тих пір, як ця опція увімкнена, студенти можуть переміщатися самостійно з однієї групи в іншу."}}}},"zh-Hans":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"关于自行注册小组","self_signup_description":"您可以创建学生能自己注册的学习小组集。学生仍限于集中的某个学习小组， 这样他们就可将自己组织成学习小组，而不需要教师这样做。请记住，只要启用此选项，学生可以将自己从一个学习小组移至另一个学习小组。"}}}},"zh-Hant":{"groups":{"manage":{"self_signup_help":{"about_self_signup_groups":"關於自行註冊群組","self_signup_description":"您可以創建群組集合，讓學生可以自行註冊。學生仍僅限於只在該集合中的一個群組中，但這樣一來，學生就可以自己組織成群組，而不需要教師來做這項工作。請注意，只要啟用此選項，學生就可以將自己從一個群組移動到另一個群組。"}}}}}'))
